import { createSelector, createFeatureSelector } from '@ngrx/store';
export const selectBlockedUsersListState = createFeatureSelector('blockedUsersListState');
export const selectBlockedUsersLists = () => createSelector(selectBlockedUsersListState, state => state.blockedUsersLists);
export const selectBlockedUsersList = id => createSelector(selectBlockedUsersListState, state => state.blockedUsersLists.find(d => d.id === id));
